import React from "react";
import { Element } from "react-scroll";
import "./MissionContainer.css";

const MissionContainer = () => {
  return (
    <Element name="Mission" className="missioncontainer">
      <div>
        <h1>Mission</h1>
        <div className="container">
        <div className="row">
          <div className="col-md-8">
            - To be a platform for the students to practically implement their
            knowledge. 
            - To kindle the spirits of students to learn and work
            together as a community. - To encourage students to spread the
            knowledge among each other. - To improve intra and inter
            departmental communication of the students to enhance their
            knowledge in various fields. - To impart the technical know-hows and
            workflows in various field of software development. - To identify
            the studentsâ€™ field of interest and provide further guidance to
            develop their own projects.
          </div>
        </div>
      </div>
      </div>
    </Element>
  );
};

export default MissionContainer;
